(function () {
  var el = document.getElementById('resource-video-blank');
  var texttracks = el.textTracks;
  if (!texttracks) {
    return false;
  }
  var texttrack = texttracks[0];
  if (!texttrack) {
    return false;
  }
  var cues = texttrack.cues;
  if (!cues) {
    return false;
  }
  var instance = cues[0];
  return !!instance;
})();

